  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Pacific
  Remote Islands National Wildlife Refuges (including Johnston Atoll, Rose Atoll,
  Howland Island, Baker Island, and Jarvis Island NWRs) outlines Refuge accomplishments
  during the 1986 calendar year. The report begins with a summary of the year's highlights
  and weather conditions. Land acquisition is covered. The report includes a planning
  section which discusses the management plan, compliance with environmental and cultural
  resource mandates, and research and investigations. Refuge administration is outlined;
  information about personnel, volunteer programs, funding, and technical assistance
  is given. Habitat management is also covered; subjects include forests, grasslands,
  and pest control. The wildlife section of the report discusses endangered and threatened
  species, waterfowl, shorebirds, raptors, marine mammals, fisheries resources, scientific
  collections, animal control, marking and banding, and disease control. The public
  uses of the Refuge described in this report include outdoor classrooms, interpretive
  programs, fishing, and law enforcement. Items of interest are provided at the end.\",\n\t\"owner_org\":
